import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Table } from 'react-bootstrap'; // Import React Bootstrap Table component if you're using Bootstrap 4 or above


const PropertyDetailsComponent = () => {
  const [propertyDetails, setPropertyDetails] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:9855/api/property/fetch')
      .then(response => {
        setPropertyDetails(response.data);
      })
      .catch(error => {
        console.error('Error fetching property details:', error);
      });
  }, []);

  return (
    <div className='container'>
      <h2 className='m-4'>Property Details</h2>
      <Table striped bordered hover> {/* Use Bootstrap Table component */}
      <thead>
        <tr>
          <th>ID</th>
          <th>MARKER VALUE</th>
          <th>AREA</th>
          <th>PINCODE</th>
          <th>BUILDING AGE</th>
          <th>PROPERTY EFFECTED</th>
          <th>SECURITY</th>
          <th>SALARIED ?</th>
          <th>PREMIUM</th>
          <th>MOBILE.NO</th>
          {/* Add more headers as needed */}
        </tr>
      </thead>
      <tbody>
      {propertyDetails ? (
        <div>
          <p><strong>Mobile:</strong> {propertyDetails.mobile}</p>
          <p><strong>Current Market Value:</strong> {propertyDetails.currentMarketValue}</p>
          <p><strong>Carpet Area:</strong> {propertyDetails.carpetArea}</p>
          <p><strong>Pincode:</strong> {propertyDetails.pincode}</p>
          <p><strong>Building Age:</strong> {propertyDetails.buildingAge}</p>
          <p><strong>Property Effect:</strong> {propertyDetails.propertyEffect}</p>
          <p><strong>Security 24x7:</strong> {propertyDetails.security24x7}</p>
          <p><strong>Is Salaried:</strong> {propertyDetails.isSalaried}</p>
          <p><strong>Premium:</strong> {propertyDetails.premium}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
      </tbody>
    </Table>
    </div>
  );
};

export default PropertyDetailsComponent;
